import React from "react";

function Products() {
  return (
    <section className="products-card">
      <img
        src="https://m.media-amazon.com/images/I/6125yAfsJKL._AC_UX575_.jpg"
        alt=""
      />
      <section className="card-details">
        <h1>SHOE</h1>
        <i class="bi bi-star-fill"></i>
        <i class="bi bi-star-fill"></i>
        <i class="bi bi-star-fill"></i>
        <i class="bi bi-star-fill"></i>
        <del>$500</del>
      </section>
    </section>
  );
}

export default Products;
